import React from 'react'
import styles from './ButtonCourseItem.module.scss'

const ButtonCourseItem = (props) => {
  const { type, onClick } = props

  const ButtonTypeCase = () => {
    switch (type) {
      case 'addToCart':
        return <button
          className={styles.buttonAddToCart}
          onClick={onClick}
          type="button"
        >
          Add to cart
        </button>
      case 'buyNow':
        return <button
          className={styles.buttonBuyNow}
          onClick={onClick}
          type="button"
        >
          Buy now
        </button>
      case 'learnNow':
        return <button
          className={styles.button}
          onClick={onClick}
          type="button"
        >
          Learn now
        </button>
      case 'extend':
        return <button
          className={styles.buttonBuyNow}
          onClick={onClick}
          type="button"
        >
          Extend
        </button>

      default:
    }
  }
  return (
    <ButtonTypeCase />

  )
}
export default ButtonCourseItem
